Went to check out the new Game Lab in Downtown Riverside yesterday. Tons of fun!! A legit arcade setting (along with pinball and VR), old school games as well as some recent ones along with a bar as well! Plus, games run on properly priced tokens (4 tokens for $1) as opposed to odd prices that you pay with a rechargeable game card of sorts. 
Plus a LOT of Super Smash Bros.

And did I mention beer!? So if you're ever in Downtown Riverside, check out the Game Lab! 
